import React from 'react';
import { Header, Footer, Main } from '../../Components';
import mockBlogs from '../../mocks/blogs';

const Home = () => {
  return (
    <div>
      <Header />
      <Main blogs={mockBlogs} />
      <Footer />
    </div>
  );
};

export default Home;
